import React, { useState } from 'react';
import CameraCapture from './components/CameraCapture';
import ChatInterface from './components/ChatInterface';
import ProductInfo from './components/ProductInfo';
import { Camera, MessageCircle, ShoppingBag } from 'lucide-react';
import apiService from './services/api';

interface ProductData {
  name: string;
  brand: string;
  price: number;
  confidence: number;
}

interface ChatMessage {
  id: string;
  type: 'user' | 'assistant';
  content: string;
  timestamp: Date;
}

function App() {
  const [activeTab, setActiveTab] = useState<'camera' | 'chat'>('camera');
  const [capturedImage, setCapturedImage] = useState<string | null>(null);
  const [productData, setProductData] = useState<ProductData | null>(null);
  const [chatMessages, setChatMessages] = useState<ChatMessage[]>([
    {
      id: '1',
      type: 'assistant',
      content: 'Hi! I\'m your shopping assistant. Take a photo of an item you\'re interested in, and I\'ll help you decide if it\'s a good time to buy!',
      timestamp: new Date()
    }
  ]);
  const [isLoading, setIsLoading] = useState(false);

  const handleImageCapture = async (imageData: string) => {
    setCapturedImage(imageData);
    setIsLoading(true);

    try {
      const response = await fetch(imageData);
      const blob = await response.blob();
      const file = new File([blob], 'captured-image.jpg', { type: 'image/jpeg' });

      const detectionResult = await apiService.detectProduct(file);

      setProductData({
        name: detectionResult.name,
        brand: detectionResult.brand,
        price: detectionResult.price,
        confidence: detectionResult.confidence
      });
      setIsLoading(false);
    } catch (error) {
      console.error('Error processing image:', error);
      setIsLoading(false);
    }
  };

  const handleChatMessage = async (message: string) => {
    const userMessage: ChatMessage = {
      id: Date.now().toString(),
      type: 'user',
      content: message,
      timestamp: new Date()
    };

    setChatMessages(prev => [...prev, userMessage]);
    setIsLoading(true);

    try {
      const chatResponse = await apiService.sendChatMessage(message, productData);

      const assistantMessage: ChatMessage = {
        id: (Date.now() + 1).toString(),
        type: 'assistant',
        content: chatResponse.response,
        timestamp: new Date()
      };
      setChatMessages(prev => [...prev, assistantMessage]);
      setIsLoading(false);
    } catch (error) {
      console.error('Error sending message:', error);
      setIsLoading(false);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100">
      <div className="container mx-auto px-4 py-8">
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold text-gray-900 mb-2">
            SnapScoutShop
          </h1>
          <p className="text-lg text-gray-600">
            Smart shopping recommendations powered by AI
          </p>
        </div>

        <div className="flex justify-center mb-8">
          <div className="bg-white rounded-lg p-1 shadow-lg">
            <button
              onClick={() => setActiveTab('camera')}
              className={`flex items-center px-6 py-3 rounded-md transition-all ${
                activeTab === 'camera'
                  ? 'bg-primary-500 text-white shadow-md'
                  : 'text-gray-600 hover:text-gray-900'
              }`}
            >
              <Camera className="w-5 h-5 mr-2" />
              Camera
            </button>
            <button
              onClick={() => setActiveTab('chat')}
              className={`flex items-center px-6 py-3 rounded-md transition-all ${
                activeTab === 'chat'
                  ? 'bg-primary-500 text-white shadow-md'
                  : 'text-gray-600 hover:text-gray-900'
              }`}
            >
              <MessageCircle className="w-5 h-5 mr-2" />
              Chat
            </button>
          </div>
        </div>

        <div className="max-w-4xl mx-auto">
          {activeTab === 'camera' ? (
            <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
              <div className="bg-white rounded-xl shadow-lg p-6">
                <h2 className="text-2xl font-semibold text-gray-900 mb-4">
                  Capture Item
                </h2>
                <CameraCapture 
                  onImageCapture={handleImageCapture}
                  isLoading={isLoading}
                />
              </div>

              <div className="bg-white rounded-xl shadow-lg p-6">
                <h2 className="text-2xl font-semibold text-gray-900 mb-4">
                  Product Details
                </h2>
                {productData ? (
                  <ProductInfo product={productData} />
                ) : (
                  <div className="text-center text-gray-500 py-12">
                    <ShoppingBag className="w-16 h-16 mx-auto mb-4 text-gray-300" />
                    <p>Take a photo to see product details and recommendations</p>
                  </div>
                )}
              </div>
            </div>
          ) : (
            <div className="bg-white rounded-xl shadow-lg">
              <ChatInterface 
                messages={chatMessages}
                onSendMessage={handleChatMessage}
                isLoading={isLoading}
                productData={productData}
              />
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
